(1908, 15, 1535731200, 8, '张春洋，本月主要负责返修品的维修相关工作， 9月份的维修完成率要稳定在70%以上，还是要针对加急件优先的原则进行维修，对于加急件要求维修时长不差过一天。另外对于大批量返修件的话，在没有加急件的时候，进行维修，并且要注意大批返修件是否存在共性问题，如果有要及时和质量部进行沟通验证。对于维修中拆掉的坏的元器件进行保存并注明型号和客户名称，交给质量部检验处理，原则上坏的元器件在返修岗位保存时间1个月，剩余的坏器件一个月以后直接进行报废处理。（5月份完成率52%，6月份完成率56%，7月份完成率70%，8月维修完成率57%）', '20180930', 25, 1, '', '', 25, 1536556096),
(1909, 15, 1535731200, 9, '张永飞，本月主要负责加试入库产品的相关工作。近期由于客户交流会的原因，需要加试入库的产品相对较多，另外还有几家退回加试入库的产品。所以9月份就加试入库的产品数量较多。本月注重处理加试入库产品。（本月要将客户交流会借出的产品加试入库完成）', '20180930', 25, 1, '', '', 25, 1536556121),
(1910, 15, 1535731200, 10, '王伟丽，主要负责返修品的收发货和登记入账及整理返修库存的相关工作，主要存在的问题还是整理库存的问题。8月份的盘库整理工作已经做到台账数量和库存数量的数据已经准确，但是送往电子车间批量加试入库的产品还有307台，将存放在电子车间控制器型号及数量进行统计到账，督促协助车间尽快完成加试。盘库的盘盈盘亏整合核对工作已完成。9月份加试入库的产品较多，因此还要加强库存账目管理，制定展品库管理细则。继续保持库存工作的零误差。一如既往的秉承有据可证、有物可寻、有数可查的最终零误差的标准来要求自己。同时要做好收到返修品后及时入返修台账和及时清理返修品包装箱的处理工作，养成以5S为标准的工作习惯。（8月份库存台账数量646台，加试入库未完成有338台，送往车间加试入库数量308台。）', '20180930', 25, 1, '', '', 25, 1536556144),
(1911, 15, 1541001600, 15, '全体区域经理，对账，要款！本年度从九月份开始催收货款！\n市场情况要款比较困难， 希望各部门配合一定不要延期交货，欠款的都是大客户，老客户，订货频率比较多。', '20181231', 25, 0, '', '', 25, 1536556444),
